I believe that he is coming back to take me and judge the world. 
Oh Father

Wash me by his blood and make me clean. 
Fill me with the Holy Spirit.
Today I am saved and I am your Child.

Jesus Christ is my Lord and Savior.
the devils chains has been broken and I am free.

Amen
