Segue:
Um drone pertencente ao grupo “drone verde”, que defende a legalização da maconha em Israel, deixou cair centenas de sacos com maconha na Praça Rabin, em Tel Aviv. Dezenas de pessoas saíram correndo para pegar quantas sacolas pudessem carregar. A informação foi publicada em um jornal local, o The Jerusalem Post.

Antes de jogar a maconha em Tel Aviv, o grupo publicou uma mensagem no Telegram, sugerindo a operação planejada. “Está na hora, meus queridos irmãos. É um pássaro? É um avião? Não, é o drone verde, distribuindo cannabis grátis do céu … Desfrutem, meus amados irmãos, este é o seu irmão piloto, certificando-se de que todos nós recebamos um pouco de amor livre “, dizia a mensagem. O slogan deles é: “Amor livre”.

A mensagem também indicava que a operação para o lançamento comemorativo do grupo de um novo sistema de entrega intitulado “chuva de cannabis”. “Estamos lançando o projeto “chuva de cannabis”, que incluirá uma entrega semanal em diferentes partes do país de 1 kg de cannabis dividido em sacos de 2 gramas gratuitos”, dizia a mensagem.

Os idealizadores da operação também abordaram a ameaça iminente de um bloqueio imposto pelo governo na tentativa de evitar a propagação da pandemia do coronavírus, explicando que a situação “exige pensar fora da caixa e descobrir novas formas de levar cannabis aos consumidores”.

