Hoje, Cosovo e Sérvia avisaram que irão passar suas embaixadas para Jerusalèm. Para entender isso temos que entender o relacionamento entre os dois países. Cosovo fazia parte da Sérvia até 2008, ano no qual o território resolveu declarar independência - sem o reconhecimento sérvio. Nos últimos tempos os EUA começaram a intervir nas relações entre os dois países, sendo assim o país que dirige as conversas entre os países do sudeste europeu. Pelo jeito, a Casa Branca conseguiu influenciar a estes países em questões que vão além do que acontece em seus territórios: os dois avisaram hoje que suas embaixadas passarão à Jerusalém. Cosovo inclusive é um país mulçumano, o que significa que este vai ser o PRIMEIRO país mulçumano a passar sua embaixada em Jerusalém - o que significa também que esta é a primeira vez que um país mulçumano reconhece Jerusalém como a capital de Israel.
