היום, נודע לנו שקוסובו וסרביה מתכווהות להעביר את שגרירויותיהן לירושלים. על מנת להבין את כינון היחסים בין קוסובו וסרביה לבין ישראל, עלינו להבין את היחסים בין המדינות עצמן. קוסובו הייתה חלק מסרביה עד 2008, כאשר היא הכריזה על עצמאות באופן חד-צדדי. כיום, שתי המדינות מחדשות את היחסים בחסות הבית לבן. כנראה שטראמפ הצליח להשפיע עליהן גם בכל מה שקשור לישראל, ועל כן הן פרסמו היום את נכונותן להעביר את השגרירויות שלהן לירושלים. בכלל, קוסובו היא מדינה מוסלמית, מה שהופך אותה למדינה המוסלמית הראשונה להקים שגרירות בירושלים ולהכיר בה כבירת ישרראל!
